import React from 'react';
import "./school.scss";

import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';

const School = () => {
    return (
        <div>
            <h4>Select Area</h4>
            <Autocomplete
                disablePortal
                id="combo-box-demo"
                options={top100Films}
                sx={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="Movie" />}
            />
        </div>
    )
}

export default School;
